		private readonly ReadOnlyMemory<ReadOnlyMemory<char>> words;

		private WordList(ReadOnlyMemory<char> lineFeedDelimitedWordList)
		{
			int longestWord = 0;
			Memory<ReadOnlyMemory<char>> wordsMemory = new ReadOnlyMemory<char>[1 << 11];
			this.words = wordsMemory;
			Span<ReadOnlyMemory<char>> wordsSpan = wordsMemory.Span;
			ReadOnlySpan<char> wordList = lineFeedDelimitedWordList.Span;
			int start = 0;
			for (int wordsFound = 0; wordsFound < wordsSpan.Length; wordsFound++)
			{
				int length = wordList[start..].IndexOf('\n');
				if (length == -1)
				{
					// Last word
					length = wordList.Length - start;
				}

				wordsSpan[wordsFound] = lineFeedDelimitedWordList.Slice(start, length);
				longestWord = Math.Max(longestWord, length);
				start += length + 1;
			}

			this.LongestWord = longestWord;
		}

		internal int LongestWord { get; }

		/// <summary>
		/// Gets the word at the specified index from the word list.
		/// </summary>
		/// <param name="index">The index of the word. Allowed range is [0, 2048).</param>
		/// <returns>The word.</returns>
		internal ReadOnlySpan<char> this[int index] => this.words.Span[index].Span;

		/// <summary>
		/// Finds the index in the word list to the specified word.
		/// </summary>
		/// <param name="word">The word to search for.</param>
		/// <returns>The index of the word, or -1 if the word does not appear in the list.</returns>
		internal int Find(ReadOnlySpan<char> word)
		{
			// PERF: We could use a binary search instead of a linear one.
			ReadOnlySpan<ReadOnlyMemory<char>> words = this.words.Span;
			for (int i = 0; i < words.Length; i++)
			{
				if (word.Equals(words[i].Span, StringComparison.OrdinalIgnoreCase))
				{
					return i;
				}
			}

			return -1;
		}
	}
